import React from 'react';
import './Button.css';

const Button = (props) => {
    if(props.type === 'submit'){
        executaAcao = () => console.log('teste')
    }
    return (
        <button type={props.type} className="button-calc" onClick={executaAcao}>{props.children}</button>
    );
}

export default Button;
